import { Injectable } from '@angular/core';
import { Databases, Query } from 'appwrite';
import { client } from '../../lib/appwrite';
import { environment } from '../../../environment';
import {
  GymRecords,
  GymRecordsDocuments,
  RunningAndCyclingRecords,
  RunningAndCyclingRecordsDocuments,
} from './interfaces/appwrite-db.interfaces';
import { catchError, from, map, Observable, of } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class AppwriteDbService {
  private database: Databases;
  private databaseId = environment.databaseId;
  private runningAndCyclingRecordsId = environment.runningAndCyclingRecordsId;
  private gymRecordsId = environment.gymRecordsId;

  constructor() {
    this.database = new Databases(client);
  }

  //get get get get get get get get get get get get get get get get

  getUserRecords(
    userId: string
  ): Observable<RunningAndCyclingRecordsDocuments[]> {
    if (!userId) {
      return of([]);
    }
    return from(
      this.database.listDocuments(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        [
          Query.equal('user_id', userId),
          Query.orderDesc('$createdAt'),
          Query.limit(1),
        ]
      )
    ).pipe(
      map(
        (response) => response.documents as RunningAndCyclingRecordsDocuments[]
      ),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of([]);
      })
    );
  }

  getUserRecordsLength(userId: string): Observable<RunningAndCyclingRecords> {
    if (!userId) {
      return of();
    }
    return from(
      this.database.listDocuments(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        [Query.equal('user_id', userId)]
      )
    ).pipe(
      map((response) => response as RunningAndCyclingRecords),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of();
      })
    );
  }

  getUserRecordsPagination(
    userId: string,
    limit: number,
    offset: number
  ): Observable<RunningAndCyclingRecordsDocuments[]> {
    if (!userId) {
      return of([]);
    }
    return from(
      this.database.listDocuments(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        [
          Query.equal('user_id', userId),
          Query.orderDesc('$createdAt'),
          Query.limit(limit),
          Query.offset(offset),
        ]
      )
    ).pipe(
      map(
        (response) => response.documents as RunningAndCyclingRecordsDocuments[]
      ),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of([]);
      })
    );
  }

  getUserGymRecords(userId: string): Observable<GymRecordsDocuments[]> {
    if (!userId) {
      return of([]);
    }
    return from(
      this.database.listDocuments(this.databaseId, this.gymRecordsId, [
        Query.equal('user_id', userId),
        Query.orderDesc('$createdAt'),
        Query.limit(1),
      ])
    ).pipe(
      map((response) => response.documents as GymRecordsDocuments[]),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of([]);
      })
    );
  }

  getUserGymRecordsLength(userId: string): Observable<GymRecords> {
    if (!userId) {
      return of();
    }
    return from(
      this.database.listDocuments(this.databaseId, this.gymRecordsId, [
        Query.equal('user_id', userId),
      ])
    ).pipe(
      map((response) => response as GymRecords),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of();
      })
    );
  }

  getUserGymRecordsPagination(
    userId: string,
    limit: number,
    offset: number
  ): Observable<GymRecordsDocuments[]> {
    if (!userId) {
      return of([]);
    }
    return from(
      this.database.listDocuments(this.databaseId, this.gymRecordsId, [
        Query.equal('user_id', userId),
        Query.orderDesc('$createdAt'),
        Query.limit(limit),
        Query.offset(offset),
      ])
    ).pipe(
      map((response) => response.documents as GymRecordsDocuments[]),
      catchError((error) => {
        console.error('Failed loading records:', error);
        return of([]);
      })
    );
  }

  getBestGymRecord(
    userId: string,
    exercise: string
  ): Observable<GymRecordsDocuments | null> {
    if (!userId || !exercise) {
      return of(null);
    }
    return from(
      this.database.listDocuments(this.databaseId, this.gymRecordsId, [
        Query.equal('user_id', userId),
        Query.equal('excercise', exercise),
        Query.orderDesc('weight'),
        Query.limit(1),
      ])
    ).pipe(
      map((response) =>
        response.documents.length > 0
          ? (response.documents[0] as GymRecordsDocuments)
          : null
      ),
      catchError((error) => {
        console.error('Failed loading best gym record:', error);
        return of(null);
      })
    );
  }

  getBestTimeRecord(
    userId: string,
    type: number,
    distance: number
  ): Observable<RunningAndCyclingRecordsDocuments | null> {
    if (!userId || !type || !distance) {
      return of(null);
    }
    return from(
      this.database.listDocuments(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        [
          Query.equal('user_id', userId),
          Query.equal('type', type),
          Query.equal('distance', distance),
          Query.orderAsc('record_time'),
          Query.limit(1),
        ]
      )
    ).pipe(
      map((response) =>
        response.documents.length > 0
          ? (response.documents[0] as RunningAndCyclingRecordsDocuments)
          : null
      ),
      catchError((error) => {
        console.error('Failed loading best time record:', error);
        return of(null);
      })
    );
  }

  //get get get get get get get get get get get get get get get get

  //create create create create create create create create create

  createNewRecord(
    user_id: string,
    distance: number,
    record_time: string,
    type: number
  ): Observable<RunningAndCyclingRecordsDocuments | null> {
    return from(
      this.database.createDocument(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        'unique()',
        {
          user_id,
          distance,
          record_time,
          type,
        }
      )
    ).pipe(
      map((response) => response as RunningAndCyclingRecordsDocuments),
      catchError((error) => {
        console.error(error);
        return of(null);
      })
    );
  }

  createNewGymRecord(
    user_id: string,
    weight: number,
    body_part: string,
    excercise: string,
    reps: number
  ): Observable<GymRecordsDocuments | null> {
    return from(
      this.database.createDocument(
        this.databaseId,
        this.gymRecordsId,
        'unique()',
        {
          user_id,
          weight,
          body_part,
          excercise,
          reps,
        }
      )
    ).pipe(
      map((response) => response as GymRecordsDocuments),
      catchError((error) => {
        console.error(error);
        return of(null);
      })
    );
  }

  //create create create create create create create create create

  //delete delete delete delete delete delete delete delete delete

  deleteEnduranceRecord(record_id: string): Observable<any> {
    return from(
      this.database.deleteDocument(
        this.databaseId,
        this.runningAndCyclingRecordsId,
        record_id
      )
    ).pipe(
      map((response) => response),
      catchError((error) => {
        console.error(error);
        return of(null);
      })
    );
  }

  deleteGymRecord(record_id: string): Observable<any> {
    return from(
      this.database.deleteDocument(
        this.databaseId,
        this.gymRecordsId,
        record_id
      )
    ).pipe(
      map((response) => response),
      catchError((error) => {
        console.error(error);
        return of(null);
      })
    );
  }

  //delete delete delete delete delete delete delete delete delete
}

import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { ID, Account } from 'appwrite';
import { client } from '../../lib/appwrite';
import { Router } from '@angular/router';
@Injectable({
  providedIn: 'root',
})
export class AuthService {
  private account: Account;
  private loggedInUserSubject = new BehaviorSubject<any>(null);
  loggedInUser$ = this.loggedInUserSubject.asObservable();
  constructor(private router: Router) {
    this.account = new Account(client);
    this.checkCurrentSession();
  }

  async login(email: string, password: string) {
    await this.account.createEmailPasswordSession(email, password);
    const user = await this.account.get();
    this.loggedInUserSubject.next(user);
  }

  async register(email: string, password: string, name: string) {
    try {
      await this.account.create(ID.unique(), email, password, name);
      return this.login(email, password);
    } catch (error) {
      console.error('Registration failed: ', error);
      throw error;
    }
  }

  async logout() {
    try {
      await this.account.deleteSession('current');
      this.loggedInUserSubject.next(null);
      this.router.navigate(['/welcome']);
    } catch (error) {
      console.error('Loggout failed: ', error);
      throw error;
    }
  }

  private isSessionChecked = false;
  async checkCurrentSession(): Promise<void> {
    if (this.isSessionChecked) return;
    try {
      const user = await this.account.get();
      this.loggedInUserSubject.next(user);
    } catch (error) {
      console.warn('No active session');
      this.loggedInUserSubject.next(null);
    } finally {
      this.isSessionChecked = true;
    }
  }
}

export type User = {
  email: string;
  password: string;
  name: string;
};

